import styled from 'styled-components';
import { Link as LinkR } from 'react-router-dom' ;
import { Link as LinkS } from 'react-scroll'; 

export const AboutContainer=styled.div`
    padding:150px 0;
    justify-content: center;
    align-items:center;
    text-align:center;
    height: 100vh;
    background-color:#26282C;
`;
